import {books} from "./BookData"
const Main = ()=>{
    return(
        <ul>
            {books.map((book)=>{
                return(
                    <li key = {book.id}>
                        <h1>{book.title}</h1>
                        <h2>{book.author}</h2>
                        <h3>{book.category}</h3>
                    </li>
                )
            })}
        </ul>
    )
}

export default Main;
